import Products from "../Products/Products";

const CategoryProd = () => {
  return (
    <div className="category-main-content">
      <div className="layout">
				<div className="category-title">
					Category dfdfdsfsg
				</div>
				<Products innerPage={true} />
      </div>
    </div>
  );
};

export default CategoryProd;
